            Assert.True(oneDyneSecondPerCentimeterToTheFifth < twoDyneSecondsPerCentimeterToTheFifth);
            Assert.True(oneDyneSecondPerCentimeterToTheFifth <= twoDyneSecondsPerCentimeterToTheFifth);
            Assert.True(twoDyneSecondsPerCentimeterToTheFifth > oneDyneSecondPerCentimeterToTheFifth);
            Assert.True(twoDyneSecondsPerCentimeterToTheFifth >= oneDyneSecondPerCentimeterToTheFifth);

            Assert.False(oneDyneSecondPerCentimeterToTheFifth > twoDyneSecondsPerCentimeterToTheFifth);
            Assert.False(oneDyneSecondPerCentimeterToTheFifth >= twoDyneSecondsPerCentimeterToTheFifth);
            Assert.False(twoDyneSecondsPerCentimeterToTheFifth < oneDyneSecondPerCentimeterToTheFifth);
            Assert.False(twoDyneSecondsPerCentimeterToTheFifth <= oneDyneSecondPerCentimeterToTheFifth);
        }

