        [Theory]
        [InlineData(1, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, 1, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, true)]  // Same value and unit.
        [InlineData(1, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, 2, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, false)] // Different value.
        [InlineData(2, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, 1, VascularResistanceUnit.MegapascalSecondPerCubicMeter, false)] // Different value and unit.
        [InlineData(1, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth, 1, VascularResistanceUnit.MegapascalSecondPerCubicMeter, false)] // Different unit.
        public void Equals_ReturnsTrue_IfValueAndUnitAreEqual(double valueA, VascularResistanceUnit unitA, double valueB, VascularResistanceUnit unitB, bool expectEqual)
        {
            var a = new VascularResistance(valueA, unitA);
            var b = new VascularResistance(valueB, unitB);

            // Operator overloads.
            Assert.Equal(expectEqual, a == b);
            Assert.Equal(expectEqual, b == a);
            Assert.Equal(!expectEqual, a != b);
            Assert.Equal(!expectEqual, b != a);

            // IEquatable<T>
            Assert.Equal(expectEqual, a.Equals(b));
            Assert.Equal(expectEqual, b.Equals(a));

            // IEquatable
            Assert.Equal(expectEqual, a.Equals((object)b));
            Assert.Equal(expectEqual, b.Equals((object)a));
        }

