                Assert.Equal("1 MPa·s/m³", new VascularResistance(1, VascularResistanceUnit.MegapascalSecondPerCubicMeter).ToString());
                Assert.Equal("1 WU", new VascularResistance(1, VascularResistanceUnit.WoodUnit).ToString());
            }
            finally
            {
                Thread.CurrentThread.CurrentCulture = prevCulture;
            }
        }

