        [Fact]
        public void ToString_SFormat_FormatsNumberWithGivenDigitsAfterRadixForCurrentCulture()
        {
            var oldCulture = CultureInfo.CurrentCulture;
            try
            {
                CultureInfo.CurrentCulture = CultureInfo.InvariantCulture;
                Assert.Equal("0.1 dyn·s/cm⁵", new VascularResistance(0.123456, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth).ToString("s1"));
                Assert.Equal("0.12 dyn·s/cm⁵", new VascularResistance(0.123456, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth).ToString("s2"));
                Assert.Equal("0.123 dyn·s/cm⁵", new VascularResistance(0.123456, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth).ToString("s3"));
                Assert.Equal("0.1235 dyn·s/cm⁵", new VascularResistance(0.123456, VascularResistanceUnit.DyneSecondPerCentimeterToTheFifth).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentCulture = oldCulture;
            }
        }

